import React, { useState, useEffect } from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import TableHead from "@mui/material/TableHead";
import TableBody from "@mui/material/TableBody";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import Paper from "@mui/material/Paper";

function Pets() {
  const [isLoaded, setIsLoaded] = useState(false);
  const [pets, setPets] = useState([]);
  const [searchResults, setSearchResults] = useState([]);
  const [formData, setFormData] = useState({
    animal: "",
    description: "",
    age: "",
    price: "",
  });

  useEffect(() => {
    fetchPets();
  }, []);

  const fetchPets = () => {
    fetch("http://localhost:3001/api?act=getall")
      .then((res) => res.json())
      .then((result) => {
        setIsLoaded(true);
        setPets(result);
      });
  };

  const addPet = () => {
    fetch(
      `http://localhost:3001/api?act=add&animal=${formData.animal}&description=${formData.description}&age=${formData.age}&price=${formData.price}`
    )
      .then((res) => res.json())
      .then(() => {
        fetchPets();
        setFormData({
          animal: "",
          description: "",
          age: "",
          price: "",
        });
      });
  };

  const deletePet = (id) => {
    fetch(`http://localhost:3001/api?act=delete&id=${id}`)
      .then((res) => res.json())
      .then(() => {
        fetchPets();
      });
  };

  const updatePet = (id, newData) => {
    fetch(
      `http://localhost:3001/api?act=update&id=${id}&animal=${newData.animal}&description=${newData.description}&age=${newData.age}&price=${newData.price}`
    )
      .then((res) => res.json())
      .then(() => {
        fetchPets();
      });
  };

  const searchPet = () => {
    fetch("http://localhost:3001/api?act=search&term=friendly%20with")
      .then((res) => res.json())
      .then((result) => {
        setSearchResults(JSON.stringify(result));
      });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleUpdate = (id) => {
    const petToUpdate = pets.find((pet) => pet.id === id);
    updatePet(id, petToUpdate);
  };

  return (
    <div>
      <h1>Server API Usage Demonstration</h1>
      <h2>Pets</h2>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Animal</TableCell>
              <TableCell>Description</TableCell>
              <TableCell>Age</TableCell>
              <TableCell>Price</TableCell>
              <TableCell>Action</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {pets.map((pet) => (
              <TableRow key={pet.id}>
                <TableCell>{pet.id}</TableCell>
                <TableCell>{pet.animal}</TableCell>
                <TableCell>{pet.description}</TableCell>
                <TableCell>{pet.age}</TableCell>
                <TableCell>{pet.price}</TableCell>
                <TableCell>
                  <Button variant="contained" onClick={() => deletePet(pet.id)}>
                    Delete
                  </Button>
                  <Button
                    variant="contained"
                    onClick={() => handleUpdate(pet.id)}
                  >
                    Update
                  </Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <br />
      <h2>Add Pet</h2>
      <TextField
        label="Animal"
        name="animal"
        value={formData.animal}
        onChange={handleInputChange}
      />
      <TextField
        label="Description"
        name="description"
        value={formData.description}
        onChange={handleInputChange}
      />
      <TextField
        label="Age"
        name="age"
        value={formData.age}
        onChange={handleInputChange}
      />
      <TextField
        label="Price"
        name="price"
        value={formData.price}
        onChange={handleInputChange}
      />
      <Button variant="contained" onClick={addPet}>
        Add Pet
      </Button>
    </div>
  );
}

export default Pets;
